import React from 'react';
import './App.css';

const Header: React.FC = () => {
  return (
    <div className="Header">HOME</div>
  )
}
const Footer: React.FC = () => {
  return (
    <div className="Footer">© All rights reserved by T.H</div>
  )
}

const App: React.FC = () => {
  const message: string = "こんちは";
  return (
    <div className="App">
      <Header />
      <p>はろー</p>
      <p>{ message }</p>
      <Footer />
    </div>
  );
}

export default App;
